<script>	
			localStorage.setItem("lasttime_new4", 0); 
			function sendAPIYT(a,b){
				iFrame.contentWindow.postMessage('{"event":"command","func":"'+a+'","args":['+b+'],"id":1,"channel":"widget"}',"*");
				
			}
			function onLoadFrame(){
				console.log("onLoadFrame");
				iFrame.contentWindow.postMessage('{"event":"listening","id":1,"channel":"widget"}',"*");
			}
			function listerYT(a){	
				if(a.origin == "https://www.youtube.com"){
					
					event=JSON.parse(a.data);
					//console.log(event);
					if(event.event=="onAdStart"){
						sendAPIYT("unloadModule",'"ad"');
						sendAPIYT("stopVideo",'""');
						sendAPIYT("playVideo",'""');							
					}
					if(event.event=="onStateChange"){
						if(event.info==1){	
							sendAPIYT("getInternalApiInterface",'""');								
						}
						if(event.info==0){							
							clearInterval(cleRTimer2);	
							localStorage.setItem("lasttime_new4", 0); 
						}
					}
					if(event.event=="onError"){				
						clearInterval(cleRTimer2);	
						localStorage.setItem("lasttime_new4", 0); 
						//window.location.href="/nee.php?sid=212013";						
					}
					if(event.event=="onReady"){
						sendAPIYT("getInternalApiInterface",'""');	
						sendAPIYT("addEventListener",'"onStateChange"');
						sendAPIYT("addEventListener",'"onAdAnnounce"');
						sendAPIYT("addEventListener",'"onAdInfoChange"');
						sendAPIYT("addEventListener",'"onAdUxClicked"');
						sendAPIYT("addEventListener",'"onAdUxUpdate"');
						sendAPIYT("addEventListener",'"onAdPlaybackProgress"');
						sendAPIYT("addEventListener",'"onAdStateChange"');
						sendAPIYT("addEventListener",'"onAdIntroStateChange"');
						sendAPIYT("addEventListener",'"onAdComplete"');
						sendAPIYT("addEventListener",'"onAdStart"');
						sendAPIYT("addEventListener",'"onAdEnd"');
						sendAPIYT("addEventListener",'"onAdMessageChange"');
						sendAPIYT("addEventListener",'"onApiChange"');
						sendAPIYT("addEventListener",'"onError"');
						sendAPIYT("unloadModule",'"ad"');
						//sendAPIYT("cuePlaylist",'["FAWgif-vKaY"]');	
						sendAPIYT("playVideo",'""');	
					}
					//if(event.event!='infoDelivery')console.log(event);
				}
			}
			if (window.addEventListener) {
				window.addEventListener("message", listerYT);
			} else {
				window.attachEvent("onmessage",  listerYT);
			}
			function getStartVideo(){};
		</script>
